import React from 'react';
import Text from '../Text';
import Input from '../Input';
import Textarea from '../Textarea';
import styles from './index.module.css';

const ProcedureForm = () =>
  <>
    <Text color="primary">
      Procedure Name
    </Text>
    <Input />
    <Text color="primary">
      Description
    </Text>
    <Textarea />
  </>

export default ProcedureForm;
